const App = () => {
  const categories = [
    {
      id: 1,
      title: "Cows",
    },
    {
      id: 2,
      title: "Rabits",
    },
    {
      id: 3,
      title: "Squids",
    },
    {
      id: 4,
      title: "Flowers",
    },
    {
      id: 5,
      title: "Misc",
    },
  ];

  return (
    <div className="categories-container">
      {categories.map(({ title }) => (
        <div className="category-container">
          <div className="background-image" />
          <div className="category-body-constainer">
            <h2>{title}</h2>
            <p>Shop Now</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default App;
